$(document).ready(function(){

	/*-----------------------------------------------
	 validate and submit forms
	------------------------------------------------*/

	$('.fm_form').each(function() {
	     $(this).validate({
	     	rules: {
				name: {required: true, minlength: 2},
				email: {required: true, minlength: 2},
				tel: {required: true, minlength: 5},
			},
		  	messages: {
			    name: "Пожалуйста, укажите ваше имя",
			    email: {
			      required: "Пожалуйста, введите ваш email",
			      email: "Пожалуйста, введите правильный email-адрес"
			    },
			    tel: "Введите ваш номер телефона",
			    fz152agree: "Нам необходимо ваше согласие: "
		  	},
		  	submitHandler: function(form) {

		  		metrika_target = $(form).attr('data-mtrtarget');

			    $.ajax({
					type: 'POST',
					url: '/site_form_handler/site_form_handler.php',
					data: $(form).serialize(), 
					success: function(data){
					   console.log(data);
					   // $('#thankyou_modal').modal('show');
					   if (data =='ok'){
						   $(form).closest('.modal-body').html('<h3>Спасибо. Ваша заявка поступила в обработку.</h3>\
						   	<p>Наши менеджеры свяжутся с вами в ближайшее время</p>');
						}

					   // yaCounterXXXXXX.reachGoal('all');
					   // if (metrika_target) {yaCounterXXXXXXX.reachGoal(metrika_target)}
					}
		        });
		        
		        // $('#callback_form_modal').modal('hide');
		        // return false;
		  	}
		});
	});



	$('[data-target="#form_modal"]').click(function(){
		$('.fm_form').find('input[name=product]').val( $(this).attr('data-product') );
	})




})
  

